const AssetsHandler = require('../classes/AssetHandler');

// Create a new AssetHandler for our assets then let us load the assets
const GUIAssets = new AssetsHandler();
async function loadAssets() {
  // Load the GZIP data into the asset
  await GUIAssets.saveGZ('icon', ``, 'data:image/svg+xml;base64,');
  GUIAssets.update('icon', (data) => btoa(data.replace('<svg ', '<svg style="fill:#ffffff;" '))); // Fix the SVG lmao
}
GUIAssets.loadAssets = loadAssets;
module.exports = GUIAssets;